import React from 'react';
import './App.scss';
import { Card } from './components/Card';

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <Card>Buffalo</Card>
        <Card>Cheese Grater</Card>
      </header>
    </div>
  );
}

export default App;
